INSERT INTO `ms_article` VALUES (1347428995495124992, 1347456734864367616, '<p>商家账号及会员账号。</p><p>用户需到前台先注册会员账号才能申请店铺入驻。</p>', 1, '商家账号注册', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:24:41', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347429491832283136, 1347456734864367616, '<p>注册商家账号后。</p><p>1.同意店铺入驻协议</p><p>2.填写公司信息。</p><p>3.填写结算账户。</p><p>4.填写店铺基础信息、申请入驻经营的商品类目。</p><p>5.提交审核，平台通过后开店成功。</p>', 2, '商家申请开店', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:26:40', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347430272568418304, 1347458431707799552, '<p><span style=\"font-size: 1em;\">可设置店铺的基础信息、退货收件地址、自提点</span></p>', 2, '店铺设置', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:29:46', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347430502135259136, 1347458431707799552, '<p>可设置多个商家客服坐席</p>', 3, '客服设置', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:30:40', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347430608918044672, 1347458431707799552, '<p>点击 设置-物流设置进行 物流设置页面。<br></p><p>可根据不同的地区设置不同的物流模板。</p><p>可选择店铺所支持的物流公司。</p>', 4, '物流设置', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:31:06', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347430851030048768, 1369921726825103362, '<p>1. 设置分组名称、设置排序。</p><p>2.店铺二级商品分类最多可设置二级</p>', 11, '店铺分类维护', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:32:04', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347431056441892864, 1369921726825103362, '<p>发布商品</p><p><strong>1、设置商品基础信息</strong>，根据系统提示设置商品名、商品图、价格、库存等，“&nbsp;*&nbsp;” 为必填项。商品图建议尺寸：800*800像素，最多上传5张商品图。<br/></p><p><strong>2、添加商品库存</strong>，如果您上传的商品为多规格的商品，您可以在商品内容中添加新的商品规格。点击添加规格图片，您可以在每个规格中添加图片，买家下单时，可以看到您上传的不同规格的不同图片。划线价：商品没有优惠的情况下，划线价在商品详情会以划线形式显示。<br/></p><p><strong>3、</strong><strong>选择物流信息，</strong>选择商品支持配送方式：快递发货、同城配送、到店自提。<br/></p><p><strong>4、编辑商品详情，</strong>您可以按照商品内容设置商品详情。<br/></p>', 1, '新建／发布商品教程', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:32:53', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347431909718515712, 1369921726825103362, '<p>满减营销<span style=\"font-size: 1em;\">功能支持设置买家购买商品达到一定金额或件数时，可享受包邮、减金额、打折、送积分、送赠品等优惠。</span></p><p>操作路径：电脑端后台 - 营销管理 - 满额管理- 满减/满送/满包邮。</p><p>设置满减的门槛。</p><p>设置满额活动的优惠内容。</p><p>例如：</p><ul><li>支持满X元减现金/打X折 &nbsp; &nbsp;例如：满100元减10元，满100元打8折选其一。</li><li>支持满X元免邮 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 例如：满100全场包邮。</li><li>支持满X元送积分 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 例如：满100元送积分5个。</li><li>支持满X元送优惠 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 例如：满100元送20元优惠券/20元优惠码选其一。</li><li>支持满X元送赠品 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 例如：满100送手机壳一个。</li></ul><p>选择参与活动的商品。</p>', 1, '如果设置满减营销', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:36:16', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347432371884679168, 1369921726825103362, '<p>电脑端后台 - 营销管理 - 拼团管理</p><p><br></p><p><strong>【基础设置】</strong></p><p>1）活动名称：保存后，支持再次修改；</p><p>2）活动时间：</p><p>a、开始时间不得早于当前时间，结束时间不得早于开始时间，不得超过店铺有效期</p><p>b、保存之后，“开始时间”不支持再次修改，“结束时间”可以进行延长，但不能提前</p><p>c、活动时间结束之后，未成团订单将自动关闭并退款，已成团订单仍需及时处理</p><p>&nbsp;</p><p>3）拼团商品：</p><p>a、可选择多个规格商品。</p><p>&nbsp;</p><p>4）拼团价设置：不同的sku可设置不同的拼团价格。</p><p>&nbsp;</p><p>5）拼团有效期：</p><p>a、开团后在有效期内邀请足够好友参团则拼团成功</p><p>b、创建后，买家可在拼团详情页看到有效期倒计时</p><p>&nbsp;</p><p>6）参团人数：开通万人团上限可至10000人，默认3人</p><p><br></p><p>虚拟成团：</p><p>a、拼团达到结束时间未达到要求，使用匿名用户拼团成功。</p>', 2, '拼团管理发布', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:38:06', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347432438783827968, 1369921726825103362, '<p><strong>功能路径</strong><br/>商城电脑端后台 - 营销管理 - 秒杀。<br/></p><p>展示秒杀列表，商家可选择秒杀活动参与活动。</p><p>选择参与活动的SKU，参与时间段，设置秒杀库存。</p>', 3, '秒杀使用教程', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:38:22', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347432646200549376, 1369921726825103362, '<p>您可以在财务对账模块<span style=\"font-size: 1em;\">查看一段时间内您店铺待对账的结算单.</span></p><p>点击明细可以查看这段时间内您店铺每笔订单/退单的收退款记录。<span style=\"font-size: 1em;\"><br/></span></p><p><span style=\"font-size: 1em;\"><br/></span></p>', 1, '如何财务对账', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:39:12', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347432993837047808, 1369921726825103362, '<p>可按照日期筛选结算单列表。</p><p>点击查看结算单详情：展示结算金额、订单/退款/分销流水列表。</p>', 2, '如何查看店铺流水历史', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:40:34', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347434714533486592, 1369921726825103362, '是', 1, '一笔订单可以使用多张优惠券吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:47:25', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347434895337349120, 1369921726825103362, '<p>一张优惠券不支持核销多次，只能核销一次。<br/></p>', 4, '一张优惠券可以核销多次吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:48:08', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347435331821789184, 1347450411015757824, '<p>已经发放到客户账号里面的优惠券可以作废，停止用户用券，但是不支持回收。</p><p>停止用券的操作路径：微商城电脑端后台 - 应用 - 营销玩法 - 优惠券 - 点击【已领取】的数量 - 进入已领取的客户列表 - 点击【停止用户用券】。</p>', 5, '如何停用发放给客户的优惠券？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:49:52', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347435630384930816, 1347450411015757824, '<p>优惠券不能用来抵扣订单中的运费。<br></p>', 6, '优惠券可以抵扣运费吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:51:03', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347435809779507200, 1369921726825103362, '<p>可以使用优惠券</p>', 7, '多人拼团订单可以使用优惠券吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:51:46', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347435999282356224, 1347450411015757824, '<p>优惠券只能在自己店铺使用，不能实现多店通用。</p>', 8, '优惠券可以多个店铺通用吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 14:52:31', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347438191145934848, 1369921726825103362, '<table><tbody><tr><td><table><tbody><tr><td><strong></strong>各位商家大家好：<br/>为了帮助用户在下单时，推荐最合理的优惠券，我们优化了选择优惠券的排序规则<br/><br/>为了更好的解释新的排序规则，我们来看一个具体的例子：订单中有商品A（价格10元）和商品B（价格10元）；用户有三张仅商品A可用的优惠券a（无门槛减50元）、优惠券b（无门槛减8元）、优惠券c（无门槛打5折），和一张商品A和B均可用的优惠券d（无门槛减70元）<br/><br/>再约定一些金额的定义：<br/>1. 减免金额：优惠券在该订单中可以减免的金额（上面例子中a优惠券的减免金额为10元）<br/>2. 优惠券面额：优惠券的面额（上面例子中a优惠券的面额为50元）<br/>3. 溢出金额：当优惠类型为满减券时，优惠面额大于参与优惠金额，超出的金额部分为溢出金额（上面例子中a优惠券的溢出金额为50-10=40元）<br/>4. 优惠券得分：得分=减免金额-溢出金额（上面例子中a优惠券打得分为10-40=-30<br/><br/>排序规则：<br/>1.先按每张优惠券的得分降序排列。<br/>2.得分一致时，优先溢出金额低的优惠券。<br/>3.溢出金额一致时，优先选择满减券，hou选择折扣券。<br/>4.以上均一致时，优先快过期的优惠券</td></tr></tbody></table></td></tr></tbody></table>', 9, '下单默认选择优惠券规则', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:01:14', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347439387113971712, 1369921726825103362, '<p>给商品创建分组后，店铺主页可以按照商品分组进行展示不同类目的商品。<br/></p>', 5, '添加商品分组，有什么作用？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:05:59', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347439575983480832, 1369921726825103362, '<p>可以上传5张，超过就无法上传了<br/></p>', 6, '商品主图可以上传多少张？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:06:44', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347439915625635840, 1369921726825103362, '<p>可上架后最晚十分钟可以展示。<br/></p>', 7, '商品上架后，多久会显示？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:08:05', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347440117820448768, 1369921726825103362, '<p>库存最大值不能超过10000000件，建议您根据实际库存进行设置。<br/></p>', 8, '商品库存有数量限制吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:08:53', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347440480636133376, 1369921726825103362, '<p>目前商品类型分为实物商品、虚拟商品。</p><p>实物商品与虚拟商品的区别：</p><p>实物商品：需实物进行发货。</p><p>虚拟商品：不需要快递，购买后获取验证码。</p>', 9, '商品类型有哪些？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:10:19', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347441567598403584, 1369921726825103362, '<p>商品编辑里面的规格名、规格值历史记录目前不支持删除。<br/></p>', 10, '商品编辑里面的规格名、规格值历史记录可以删除吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:14:39', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347441948684476416, 1369921726825103362, '<p>一个商品可以添加3个主规格，每个主规格可以添加200个子规格（注：子规格总字数需在5000字以下）。</p><p>超过600个的情况下建议发布成多个商品。</p>', 3, '一个商品可以添加多少规格？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:16:09', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347444467808624640, 1369921726825103362, '<p>商品销量不会减少哦。商品销量是历史已发生的，不会因为删除规格而改变。<br/></p>', 4, '商品如果删除其中一个规格，商品详情中展示的总销量会减少吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:26:10', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347445328169426944, 1369921726825103362, '<p>多人拼团有虚拟成团的功能。</p><p>在新建多人拼团活动的时候，如果想要提高成团率，可以展开高级设置，勾选模拟成团。如果不希望买家虚拟成团，则可以不勾选虚拟成团。<br/>开启模拟成团后，满足条件的团，系统将会模拟“匿名买家”凑满该团，仅需对真实拼团买家发货。建议合理开启，以提高成团率。</p>', 18, '多人拼团有虚拟成团的功能吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:29:35', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347445482180075520, 1369921726825103362, '<p>已成团订单其中1笔申请退款，按正常订单处理，这个团的其他订单不受影响，还是可以正常发货的。<br/></p>', 19, '已成团订单，其中有一人申请退款，对同团其他订单有影响吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:30:12', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347445690712481792, 1369921726825103362, '<p>123</p>', 1, '多人拼团活动结束后，还未成团的订单会怎么样？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:31:02', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347445984301178880, 1347450411015757824, '是', 1, '如何取消多人拼团订单？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:32:12', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347449374255112192, 1347450411015757824, '是', 1, '一个商品只能参加一个拼团活动吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:45:40', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347449767181705216, 1347450411015757824, '是', 1, '拼团商品可以选择自提吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:47:14', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347450051882672128, 1369921726825103362, '<p>阿迪散发的撒发</p><p>sad发生地方</p>', 1, '虚拟商品可以参加多人拼团吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 15:48:21', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347455276571975680, 1369921726825103362, '<p>设置商品规格后，要在[商品库存]区域分别去单独设置不同规格的价格、库存等信息。</p><p>商品可以添加3个主规格，每个主规格可以添加200个子规格（在该子规格总字数不超过5000个字的情况下）。</p><p>商品名称您可以手动输入，例如颜色、款式。注意：输入具体规格参数时，点击【回车键】即可键入。<br/></p><p>在规格名中您可以填写规格值，例如衣服、鞋子尺码。在一个商品中，支持设置多个规格名和规格值。<br/></p><p>您可以设置多个商品规格，但是商品规格为包含关系，即买家需要全选您设置的规格，例如您设置了3个规格名，买家需要选择全部三个规格才可以下单，不然无法下单。因此建议您仅设置一个规格名，多个规格值哦。<br/></p><p>勾选添加规格图片，您可以在您的每一个分规格中添加图片。仅支持为第一组规格设置规格图片（最多40张图），买家选择不同规格会看到对应规格图片，建议尺寸：800 x 800像素</p><p>如果您需要删除商品规格请您编辑商品选择商品规格，点击右侧×图标即可。</p>', 2, '商品规格设置教程', 'OTHER', b'1', b'0', 'admin', '2021-01-08 16:09:07', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347460085660278784, 1369921726825103362, '<p>直接在商品管理页面，鼠标悬放至对应商品，修改商品库存。<br/></p><p>不同的规格可设置不同的库存数量</p>', 12, '怎么修改商品库存？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 16:28:14', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347466553893609472, 1369921726825103362, '<p>操作路径：商城电脑端后台 - 订单 - 交易列表 - 查看详情 - 收货人信息 - 修改。<br/></p><p>1.只有待付款或待发货的订单支持修改</p><p>2.只有配送方式是快递发货的订单支持修改<br/></p>', 1, '如何修改订单收货地址？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 16:53:56', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347467444453400576, 1369921726825103362, '<p>订单发货操作路径：电脑端后台 - 订单 - 订单查询，找到待发货的订单并点击发货。<br/></p><p>选择快递公司并填写运单号。</p>', 1, '如何订单发货', 'OTHER', b'1', b'0', 'admin', '2021-01-08 16:57:28', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347471480271429632, 1347450411015757824, '<p>一个秒杀活动只能参与一次，不能重复提交参加。<br></p>', 10, '一个秒杀活动能参与多次吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-08 17:13:30', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347476270544084992, 1347458431707799552, '<p>店铺首页分为：移动端、PC端。</p><p>店铺可以有多个首页，可选择其中一个进行发布。</p><p>页面设置中，商家可拖拽各种模块进行装修。</p>', 1, '如果发布店铺首页', 'OTHER', b'1', b'0', 'admin', '2021-01-08 17:32:32', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347488132622999552, 1369921726825103362, '<p>订单金额为：周期内的付款订单。</p><p>退款金额为：周期内的退款金额。</p><p>佣金金额为：周期内订单平台收取的佣金。</p><p>商品分销金额：周期内订单产生的分销佣金。</p><p>平台优惠券金额：周期内订单使用的平台优惠券平台承担部分的金额。</p><p>退还佣金：退款订单平台收取的佣金。</p><p>退还平台优惠券：退款订单商家收取的平台优惠券金额。</p><p><br/></p><p>结算金额=订单金额-平台分佣-退单金额-商品分销费用-退还平台优惠券+退还佣金+平台优惠券+积分抵现金额。</p><p><br/></p><p>商品分销费用不进行退还。</p>', 4, '结算规则', 'OTHER', b'1', b'0', 'admin', '2021-01-08 18:19:41', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347488451167805440, 1369921726825103362, '<p>目前平台支持开具增值税普通发票。</p><p>发票管理只展示用户提交的发票信息，不进行实际发票开具操作。</p>', 3, '商家开具发票', 'OTHER', b'1', b'0', 'admin', '2021-01-08 18:20:57', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347731598330322944, 1347730780659146752, '<p>用户前台创建订单。订单状态为：待付款。</p><p>点击 订单-订单列表-详情-确定收款，进行收款。</p><p>后台确定收款的订单，退款时需填写收款银行信息。</p>', 1, '平台如何在后台收款？', 'OTHER', b'1', b'0', 'admin', '2021-01-09 10:27:07', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347732213374672896, 1347732008847826944, '<p>同一时间只能发布一个秒杀活动。</p>', 1, '同一时间可以发布多个秒杀活动吗？', 'OTHER', b'1', b'0', 'admin', '2021-01-09 10:29:34', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1347733073714503680, 1347732307880730624, '<p>每个商家有不同的结算周期。</p><p>商家按照不同的结算周期生成结算单。</p><p>商家对账完结算单后此结算单可进行结算。</p><p>平台按照商家入驻时填写的银行进行进行线下结算。</p>', 1, '如何与商家结算？', 'OTHER', b'1', b'0', 'admin', '2021-01-09 10:32:59', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1364720226167422976, 1369921726825103362, '<p>一个商品同一时间段只能设置 1 个满额活动，不同时段可以设置不同的满额活动。<br/></p>', 20, '一个商品可以设置几个满额活动？', 'OTHER', b'1', b'0', 'admin', '2021-02-24 23:33:52', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1364722349428965376, 1369921726825103362, '<p>促销活动：分为单品促销、店铺促销、优惠券。</p><p>单品促销：拼团、限时抢购、单品立减、第二件*折。</p><p>店铺促销：满额活动（满减、满折、满送）。</p><p>优惠券：店铺优惠券、平台优惠券。</p><p><br/></p><p>促销计算顺序。</p><p>商品金额-单品促销金额-店铺促销金额-优惠券优惠券=订单价格。</p><p>在计算前一种规则后再进行下一项的计算。</p><p><br/></p><p>如果出现：</p><p>商品金额：100元</p><p>单品促销金额：90元</p><p>店铺满额活动：满100减10.</p><p>如果购买一件商品则无法使用店铺满额活动。</p>', 21, '促销计算规则', 'ANNOUNCEMENT', b'1', b'0', 'admin', '2021-02-24 23:42:18', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1369921919213633536, 1369921726825103360, '<p><span style=\"font-size: 1em;\">一个商品同一时间段只能设置 1 个满额活动，不同时段可以设置不同的满额活动。</span><br></p>', 1, '一个商品可以设置几个满额活动？', 'ANNOUNCEMENT', b'1', b'0', 'admin', '2021-03-11 02:03:32', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1369922025446965248, 1369921726825103360, '<p>公告公告公告，嘿嘿嘿~~~~</p><p>一个秒杀活动只能参与一次，不能重复提交参加。</p>', 2, '一个秒杀活动能参与多次吗？', 'ANNOUNCEMENT', b'1', b'0', 'admin', '2021-03-11 02:03:57', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1369922111602163712, 1369921726825103360, '<p><span style=\"font-size: 1em;\">订单金额为：周期内的付款订单。</span><br></p><p><br>退款金额为：周期内的退款金额。<br><br>佣金金额为：周期内订单平台收取的佣金。<br><br>商品分销金额：周期内订单产生的分销佣金。<br><br>平台优惠券金额：周期内订单使用的平台优惠券平台承担部分的金额。<br><br>退还佣金：退款订单平台收取的佣金。<br><br>退还平台优惠券：退款订单商家收取的平台优惠券金额。<br><br><br><br>结算金额=订单金额-平台分佣-退单金额-商品分销费用-退还平台优惠券+退还佣金+平台优惠券+积分抵现金额。</p>', 3, '店铺与平台的结算规则', 'ANNOUNCEMENT', b'1', b'0', 'admin', '2021-03-11 02:04:18', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1370177884043345920, 1369921726825103360, '<p><span style=\"font-size: 1em;\">多人拼团有虚拟成团的功能。</span><br></p><p>在新建多人拼团活动的时候，如果想要提高成团率，可以展开高级设置，勾选模拟成团。如果不希望买家虚拟成团，则可以不勾选虚拟成团。<br>开启模拟成团后，满足条件的团，系统将会模拟“匿名买家”凑满该团，仅需对真实拼团买家发货。建议合理开启，以提高成团率。</p>', 1, '多人拼团有虚拟成团的功能吗？', 'ANNOUNCEMENT', b'1', b'0', 'admin', '2021-03-11 19:00:39', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1370178083092430848, 0, '<p><span style=\"font-size: 1em;\">商品编辑里面的规格名、规格值历史记录目前不支持删除。</span><br></p>', 1, '商品编辑里面的规格名、规格值历史记录可以删除吗？', 'OTHER', b'1', b'0', 'admin', '2021-03-11 19:01:26', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1370178171978121216, 0, '<p>已成团订单其中1笔申请退款，按正常订单处理，这个团的其他订单不受影响，还是可以正常发货的。</p>', 1, '已成团订单，其中有一人申请退款，对同团其他订单有影响吗？', 'OTHER', b'1', b'0', 'admin', '2021-03-11 19:01:48', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1370178254094204928, 1369921726825103360, '<p>优惠券不能用来抵扣订单中的运费。</p>', 1, '优惠券可以抵扣运费吗？', 'OTHER', b'1', b'0', 'admin', '2021-03-11 19:02:07', '2021-07-08 11:19:19');
INSERT INTO `ms_article` VALUES (1371779927900160000, 1371779742369316864, '<p>APP隐私协议<br/>以下隐私协议是山西码神之路教育科技有限公司（以下简称\"我们\"） 对用户隐私保护的许诺，请您务必仔细阅读，以了解我们关于管理您个人信息的情况。本隐私协议属于\"山西码神之路教育科技有限公司软件使用协议\"的重要组成部分，与其具有同等法律效力。<br/><br/>1.概述<br/>山西码神之路教育科技有限公司为码神SHOP的所有者及运营者，我们有义务尊重任何访问码神SHOP App的隐私。本协议旨在告知您我们关于收集、使用和披露您通过码神SHOP App提交给我们的任何个人信息和匿名信息的政策和行为规范。<br/>\"个人信息\"是指您通过码神SHOP App上传的个人信息，包括但不限于姓名、地址、电子邮件地址、手机号码、社交账号、个人通过App采集的GPS定位数据、运动数据及身体数据信息，以及与上述内容相关的其他非公开信息。<br/>\"匿名信息\"是指与您的个人信息无关或无联系的信息；匿名信息不允许透露个人身份。<br/>查看和登录码神SHOP App即表示您已阅读、理解并同意本隐私协议全文。如果您不同意本隐私协议的所有内容，您的唯一且独有的补救措施就是立即停止查看和使用码神SHOP App。<br/><br/>2.用户同意<br/>通过码神SHOP App提交个人信息，即表示您同意本隐私协议并明确同意按照本协议约定对您的个人信息进行处理。我们对您个人信息的处理可能在收集信息的所在国进行，也可能在其他国家进行，但无论如何，我们都会严格遵守信息处理国当地关于处理个人信息相关法律法规。 从您那里收集的个人信息帮助我们提供App里面数据的展示，有助于我们了解访客、我们的用户和潜在用户。通过使用这些信息，我们更好地优化我们产品并为服务功能的升级提供更好的支持，从而为您提供更好的服务。<br/><br/>3.我们收集的信息<br/>1）您向我们提供的个人信息 为了给您提供完整的数据化服务，当您成为码神SHOP App的注册用户时，我们会收集您的手机号码、社交账号信息等；当您使用码神SHOP App时，我们会收集：您店铺的收入、消课等运营数据、您以及您会员的身高、体重、出生年月、上课数据、身体数据、心率数据或GPS定位数据等；当您回复我们的用户满意度调查时，我们会收集您的姓名和电子邮件地址；当您使用 码神SHOP App上传数据给我们时，我们会收集您的相关个人信息和运动数据。<br/>2）凭借技术收集的个人信息 当您注册或使用App时，某些信息可能也会被动收集，包括您的网络通信协议地址（\"IP地址\"）、浏览器类型、域名、访问时间以及操作系统等。我们也会使用 \"Cookies\"和包括统一资源定位器（URL）在内的导航数据，来收集您的访问日期和时间，以及您搜索和浏览的信息。收集这些类型的信息可以让我们的产品和服务为您提供更有针对性的帮助。在我们向您发送的电子邮件中，有的会包含\"点击URL\"，基于方便您的考虑，当您点击这些URL时，您将通过我们的网络服务器到达目标网站。通过追踪点击率，能帮助我们确定您对特定主题的兴趣，还能帮助我们衡量发送用户通信的有效性。<br/>\"IP地址\" 是在您使用网络时向您的电脑自动分配的数字。在某些情况下，您的IP地址在浏览不同会话时是保持不变的；但是如果您使用的是消费者网络访问提供商，您的IP地址在不同会话时可能不同。我们仅追踪和会话Cookies相连的IP地址，用来分析我们网站的流量情况。<br/>\"Cookies\"是在您浏览一个网站时，网站向您的电脑硬盘驱动器发送的一个小型信息片段。我们可能使用会话Cookies（一旦关闭网页浏览器便会失效）和持久性Cookies（会一直保存在您的电脑上直到您删除它们），从而向您提供更加私人化和更具互动性的网站体验。按照网络浏览器帮助文件指南，您就能删除持久性 Cookies。如果您选择禁用Cookies，网站的某些区域可能不会正常工作。<br/>3）从其他资源得到的个人信息 我们可能通过包括邮件、电话或传真在内的其他资源获得您的个人信息。我们可能将这些信息与我们已通过本网络收集的您的信息合并在一起，从而改进我们提供的产品和服务。<br/>4）用户反馈 如果您在码神SHOP App向我们提供反馈，对于反馈中包含的您的个人信息，我们亦会按照本协议的约定进行保密，我们也将利用这些反馈信息来更好的提升我们的产品及服务。<br/><br/>4.个人信息披露<br/>除非本隐私协议另有说明，否则我们通常不会向第三方交换、出租或共享您的个人信息。除非您提出要求或得到您的书面允许。 基于处理付款、货物配送或帮助您使用码神SHOP App的需要（如有些服务需要我们与第三方服务商同时向您提供服务），我们可能向第三方共享您的相关个人信息。除非提供服务的需要，否则这些第三方不得使用您的个人信息，他们使用您的个人信息的行为会受到相关保密协议的约束且有些服务的提供还需要您亲自操作后才可生效（如支付行为）。<br/>目前我们不会与我们的关联公司（包括但不限于我们的母公司、子公司以及其他与我们有关联关系的公司）共享您的个人信息；但是将来如果我们要与这些附属公司共享您的部分或全部个人信息，我们会要求他们遵守本隐私协议。 除非本隐私政策中另有说明，经过您的允许或者在以下情况下，否则我们不会与第三方分享您的个人信息。<br/>1）服务要求披露。我们会向帮助提供服务的有关人员披露个人信息，包括执行技术、运营和数据处理任务（如托管、计费、实施、数据存储和安全）的人员。<br/>2）法律要求或为了保护权利。如果法律要求，或者为了响应传票或法院指令，或者当我们单方面有合理的理由认为为了保护码神SHOP App、第三方或一般大众的财产或权利必须进行披露时，我们将披露个人信息。<br/>3）业务转让、破产。如果进行合并、收购或破产或者销售我们的部分或全部资产，我们有权将拥有的所有个人信息转让给接任的组织。除了破产或其它法院指定的范围，使用和披露所有转让的个人信息将受本隐私协议的约束，如果您被通知将出台新的隐私协议，本隐私协议有可能停止，则使用和披露行为受新隐私协议的约束。但是，转让后提交或收集的个人信息须遵守码神HOP App的接任组织制定的新隐私协议或政策。<br/>您在码神SHOP App内发布信息时，应严格遵守相关规定，如果我们发现您发布法律、法规禁止发布或者传输的信息，我们有权立即停止传输该信息，采取消除等处置措施，保存有关记录，并向有关主管部门报告。<br/>如果有其他客户发现您发布的信息泄露个人身份、散布个人隐私等侵害其合法权益，或您如在我们许可的情况下发布商业性电子信息，而其他客户表示遭受侵扰，这些客户有权要求我们删除您发布的信息，或者采取其他必要措施予以制止。我们将会依法采取这些措施。<br/><br/>5.您的选择<br/>在收集、使用和共享您的个人信息方面，我们为您提供多个选择。当您通过码神SHOP App进行课程预约、课程训练或者下单购物时，您可以选择接收我们发送的课程及促销资讯。您可以注明希望停止接收我们发送的更多资讯，而且您可以直接联系我们（请查看下方的联系信息）来取消订阅。尽管您注明了您的电子邮件或手机短信偏好，我们可能还是会向您发送我们认为重要的信息。<br/><br/>6.其他网站<br/>基于码神SHOP App运营考虑和需要，我们可能会向您提供任何其他网站或地址的链接，这样做旨在为您提供方便，不表示我们认可这些网站或地址或其内容。我们不会控制、审查这些外部网站或其内容，亦不对其承担责任。请注意，我们的隐私协议并不适用于这些外部网站。<br/><br/><br/>7.隐私协议更新<br/>根据国家法律法规的更新及App运营需要，我们有权对本协议不时地进行修改，修改后的隐私协议一旦被张贴在码神SHOP App即生效力，并代替原来的隐私协议。您可随时登录查阅最新隐私协议内容。如您不同意更新后的隐私协议，应立即停止接受码神SHOP App提供的服务；如您继续使用码神SHOP App提供的服务，即视为同意更新后的隐私协议。我们建议您在使用码神SHOP App之前阅读本隐私协议及本站的公告。如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余协议的有效性和可执行性。<br/></p>', 1, '隐私策略', 'PRIVACY_POLICY', b'1', b'0', 'admin', '2021-03-16 06:06:36', '2021-07-08 11:19:19');
