INSERT INTO `ms_article` VALUES (1371992704333905920, 1371779742369316864, '<p>用户注册及使用APP隐私协议<br/><br/>在此特别提醒您（用户）在注册成为用户之前，请认真阅读本《用户协议》（以下简称“协议”），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。您的注册、登录、使用等行为将视为对本协议的接受，并同意接受本协议各项条款的约束。本协议 约定 山西码神之路教育科技有限公司（以下简称“码神SHOP”）与用户之间关于“喵小瞳”软件服务（以下简称“服务“）的权利义务。“用户”是指注册、登录、使用本服务的个人。本协议可由码神SHOP随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本APP中查阅最新版协议条款。在修改协议条款后，如果用户不接受修改后的条款，请立即停止使用喵小瞳提供的服务，用户继续使用服务将被视为接受修改后的协议。 INSERT INTO `ms_article` VALUES (1394449958765068288, 1394449540941086720, '<p>1.加载“统一社会信用代码”的营业执照（根据2014年10月1日生效的《企业经营异常名录管理暂行办法》，需确保未在企业经营异常名录中且所售商品属于经营范围内）；</p><p>2.一般纳税人资格证复印件（选择FBP模式或“家电”类目商家必须提供，其他模式尽量提供）；</p><p>3.银行开户许可证复印件；（须有中国人民银行盖章，法人代表与营业执照一致，不一致请提供工商局出具的变更证明；）</p><p>4.法定代表人身份证正反面复印件。</p>', 1, '店铺入驻协议', 'STORE_REGISTER', b'1', b'0', 'admin', '2021-05-18 08:29:12', '2021-07-08 11:19:19');
